// import style from './Landing.module.css';
import { Link } from 'react-router-dom';
import dektop from '../../img/deskt.svg';
import icon1 from '../../img/icon1.png';
import icon2 from '../../img/icon2.png';
import icon3 from '../../img/icon3.png';

const Landing = () => {
    return(
        <div className='flex w-fit p-8 m-8 border-4 border-white rounded-lg'>
            <div className='w-fit p-8 m-8 border-4 border-white rounded-lg'>
                <h1 className='text-5xl text-white'>Hi there!... I'm Cesar, I am a Full Stack  Web Developer.</h1>
                <p className='text-3xl text-white'>focused on crafting the Tools you are looking for. </p>
                <Link to='/contact' className='flex w-fit p-8 m-8 border-4 border-white rounded-lg'> 
                    <h1 className='text-5xl text-white'>Go get in touch</h1>
                    <img className='m-5 p-3' src={icon1} alt="icon1" />
                    <img className='m-5 p-3' src={icon2} alt="icon2" />
                    <img className='m-5 p-3' src={icon3} alt="icon3" />
                </Link>
            </div>
            <div className=''><img src={dektop} alt="Cesar" /></div>
        </div>
    )
}

export default Landing;
